import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; 2025 Veni Vidi Laundry. All rights reserved.</p>
        <p>Serving South West London, Central London, Heathrow, Staines, and Weybridge</p>
      </div>
    </footer>
  );
};

export default Footer;
